INSERT INTO `aggregator_item` VALUES (2,1,'Springboard 4.4','http://www.jacksonriver.com/springboard-44','admin','<div class=\"field field-name-body field-type-text-with-summary field-label-hidden\"><div class=\"field-items\"><div class=\"field-item even\"><p>This release has some great features:</p><ul><li>Improved Admin UI and in-app reporting/exporting</li><li>Peer-to-peer fundraising</li><li>Gateway response data mapped to Salesforce</li><li>Offline donations phase 1</li></ul><p>Stay tuned!</p></div></div></div>',1409255611,'535 at http://www.jacksonriver.com'),(3,1,'Springboard 4.4.1 Released','http://www.jacksonriver.com/springboard-441-released','admin','<div class=\"field field-name-body field-type-text-with-summary field-label-hidden\"><div class=\"field-items\"><div class=\"field-item even\"><p>The release of <a href=\"http://github.com/JacksonRiver/springboard_modules/releases/tag/7.x-4.4.1\">Springboard 4.4.1</a> brings you access to some new features that we\'re really excited about, including:</p></div></div></div>',1409691379,'538 at http://www.jacksonriver.com'),(4,1,'Introducing Springboard Peer-to-Peer','http://www.jacksonriver.com/news/introducing-springboard-peer-peer','katemckenney','<div class=\"field field-name-body field-type-text-with-summary field-label-hidden\"><div class=\"field-items\"><div class=\"field-item even\"><p>We are very excited to announce the release of Springboard Peer-to-Peer Fundraising and Advocacy. Springboard clients are now able to build custom peer-to-peer campaigns that inspire their members and activists to take personal charge of supporting a cause. Because Peer-to-Peer was built on the power of Springboard, it is a flexible, configurable campaign platform that will integrate seamlessly into clients’ sites and Salesforce instances. </p>\n</div></div></div><div class=\"field field-name-field-tags field-type-taxonomy-term-reference field-label-above\"><div class=\"field-label\">Tags:&nbsp;</div><div class=\"field-items\"><div class=\"field-item even\"><a href=\"/taxonomy/term/35\">springboard</a></div><div class=\"field-item odd\"><a href=\"/news/tags/peer-peer\">peer-to-peer</a></div><div class=\"field-item even\"><a href=\"/news/tags/p2p\">p2p</a></div><div class=\"field-item odd\"><a href=\"/news/tags/fundraising\">fundraising</a></div><div class=\"field-item even\"><a href=\"/news/tags/advocacy\">advocacy</a></div><div class=\"field-item odd\"><a href=\"/news/tags/online-fundraising\">online fundraising</a></div><div class=\"field-item even\"><a href=\"/news/tags/jackson-river\">Jackson River</a></div><div class=\"field-item odd\"><a href=\"/news/tags/petitions\">petitions</a></div><div class=\"field-item even\"><a href=\"/news/tags/campaigns\">campaigns</a></div></div></div>',1410178663,'539 at http://www.jacksonriver.com');
