DROP TABLE IF EXISTS `salesforce_log_batch`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `salesforce_log_batch` (
  `bid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Unique id of this batch.',
  `start` int(11) DEFAULT NULL COMMENT 'Timestamp of when this batch started.',
  `end` int(11) DEFAULT NULL COMMENT 'Timestamp of when this batch finished.',
  `count` int(11) DEFAULT NULL COMMENT 'Total amount of items in this batch.',
  `successes` int(11) DEFAULT '0' COMMENT 'Count of successfully synced items.',
  `failures` int(11) DEFAULT '0' COMMENT 'Count of failed items.',
  `module` varchar(255) DEFAULT NULL COMMENT 'Name of the module that implements the Drupal type.',
  `delta` varchar(255) DEFAULT NULL COMMENT 'Name or id of the Drupal sub-type.',
  `object_type` varchar(255) DEFAULT NULL COMMENT 'The Salesforce object type.',
  `operation` varchar(10) DEFAULT NULL COMMENT 'The action to take in Salesforce.',
  PRIMARY KEY (`bid`),
  KEY `end` (`end`),
  KEY `failures` (`failures`),
  KEY `module` (`module`),
  KEY `object_type` (`object_type`),
  KEY `operation` (`operation`),
  KEY `successes` (`successes`),
  KEY `delta_module_object` (`delta`,`module`,`object_type`),
  KEY `end_bid` (`end`,`bid`),
  KEY `fail_module` (`failures`,`module`),
  KEY `fail_module_object_op` (`failures`,`module`,`object_type`,`operation`),
  KEY `fail_object` (`failures`,`object_type`),
  KEY `fail_object_op` (`failures`,`object_type`,`operation`),
  KEY `fail_op` (`failures`,`operation`),
  KEY `module_object` (`module`,`object_type`),
  KEY `module_object_op` (`module`,`object_type`,`operation`),
  KEY `module_op` (`module`,`operation`),
  KEY `object_op` (`object_type`,`operation`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Logs data for the Salesforce Sync.';
